"""Helpers for managing development personas when Dex mock OAuth is enabled."""

from __future__ import annotations

import json
import logging
from dataclasses import dataclass, field
from hashlib import sha256
from pathlib import Path
from typing import Any, Dict, List, Optional

from ..shared import config_settings

logger = logging.getLogger(__name__)

PAPERS2CODE_ROOT = Path(__file__).resolve().parents[1]


def _resolve_path(candidate: Optional[str]) -> Optional[Path]:
    if not candidate:
        return None
    path = Path(candidate)
    if not path.is_absolute():
        path = PAPERS2CODE_ROOT / path
    return path if path.exists() else None


@dataclass
class DevPersona:
    id: str
    provider: str
    email: Optional[str] = None
    username: Optional[str] = None
    display_name: Optional[str] = None
    avatar_url: Optional[str] = None
    numeric_id: Optional[int] = None
    google_sub: Optional[str] = None
    bio: Optional[str] = None
    role: Optional[str] = None
    linked_persona_id: Optional[str] = None
    tags: List[str] = field(default_factory=list)
    raw: Dict[str, Any] = field(default_factory=dict)

    def ensure_numeric_id(self) -> int:
        if self.numeric_id is not None:
            return self.numeric_id
        source = self.id or (self.email or self.username or "persona")
        digest = sha256(source.encode("utf-8")).hexdigest()[:12]
        self.numeric_id = int(digest, 16)
        return self.numeric_id

    def public_dict(self) -> Dict[str, Any]:
        return {
            "id": self.id,
            "provider": self.provider,
            "email": self.email,
            "username": self.username,
            "displayName": self.display_name,
            "avatarUrl": self.avatar_url,
            "role": self.role,
            "linkedPersonaId": self.linked_persona_id,
            "tags": self.tags,
        }


class DevPersonaManager:
    def __init__(self, persona_file: Optional[str]):
        self.personas_by_id: Dict[str, DevPersona] = {}
        self.defaults_by_provider: Dict[str, DevPersona] = {}
        self._load_personas(persona_file)

    def _load_personas(self, persona_file: Optional[str]) -> None:
        resolved = _resolve_path(persona_file)
        if not resolved:
            logger.info("Dex persona file not found; continuing with mock defaults")
            return
        try:
            data = json.loads(resolved.read_text(encoding="utf-8"))
        except Exception as exc:
            logger.error("Failed to parse Dex persona file %s: %s", resolved, exc)
            return
        personas = data.get("personas", [])
        for entry in personas:
            persona = DevPersona(
                id=entry.get("id"),
                provider=(entry.get("provider") or "github").lower(),
                email=entry.get("email"),
                username=entry.get("username"),
                display_name=entry.get("displayName") or entry.get("name"),
                avatar_url=entry.get("avatarUrl"),
                numeric_id=entry.get("numericId"),
                google_sub=entry.get("googleSub"),
                bio=entry.get("bio"),
                role=entry.get("role"),
                linked_persona_id=entry.get("linkedPersonaId"),
                tags=entry.get("tags", []),
                raw=entry,
            )
            if not persona.id:
                continue
            persona.ensure_numeric_id()
            self.personas_by_id[persona.id] = persona
            self.defaults_by_provider.setdefault(persona.provider, persona)
        logger.info(
            "Loaded %s Dex dev personas from %s", len(self.personas_by_id), resolved
        )

    def list_personas(self, provider: Optional[str] = None) -> List[Dict[str, Any]]:
        provider = provider.lower() if provider else None
        personas = (
            persona for persona in self.personas_by_id.values()
            if provider is None or persona.provider == provider
        )
        return [persona.public_dict() for persona in sorted(personas, key=lambda p: p.id)]

    def select(self, provider: str, persona_id: Optional[str]) -> Optional[DevPersona]:
        if not persona_id:
            return None
        persona = self.personas_by_id.get(persona_id)
        if not persona:
            logger.warning("Requested persona %s not found", persona_id)
            return None
        if persona.provider != provider:
            logger.warning(
                "Persona %s is for %s but attempted to use with %s", persona_id, persona.provider, provider
            )
            return None
        return persona

    def default_for(self, provider: str) -> Optional[DevPersona]:
        return self.defaults_by_provider.get(provider)

    def is_valid(self, provider: str, persona_id: Optional[str]) -> bool:
        return self.select(provider, persona_id) is not None

dev_persona_manager = DevPersonaManager(config_settings.DEX_PERSONA_FILE)
